import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

const Page = () => {
    return (
        <div>
            <div className="navbar">
                <div className="container-lg">
                    <a href="#" className="navbar-brand"></a>
                </div>
            </div>
            <i class="bi bi-arrow-down-left-square-fill"></i>
        </div>
    );
}

export default Page;
